INSERT INTO `services` (`id`, `name`, `image`, `description`, `status`, `created_at`, `updated_at`) VALUES
(6, 'Plumbing', , '<p>If there is any issue of pipeline or water appliances than just take the services from expert team of HomeService. Our team will arrange plumbers in shortly at your requested area.<br />\r\n<br />\r\n<strong>Our plumbers department will deliver you following services:</strong></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:14px\">Fixture repair and installation.</span></li>\r\n	<li><span style=\"font-size:14px\">Identification of water quality.</span></li>\r\n	<li><span style=\"font-size:14px\">Water piping repair and installation.</span></li>\r\n</ul>\r\n', '1', NULL, NULL);
INSERT INTO `services` (`id`, `name`, `image`, `description`, `status`, `created_at`, `updated_at`) VALUES
(7, 'Carpentry', , '<p>Today most of things in our home are wooden based, so if it is broken then we will fix it with our services. Our carpenters do their job with the perfection and if you need to replace it than we will provide you with replacement and installation with the new one. They will furnish your wooden material fully and will turn home in a new modern look.<br />\r\n<br />\r\n<strong>Following points we cover while providing services under carpenter job:</strong></p>\r\n\r\n<ul>\r\n	<li>&nbsp;Chair and table construction and repairs.</li>\r\n	<li>&nbsp;Wardrobe, frames repairs.</li>\r\n	<li>&nbsp;Doors and windows repairs and construction.</li>\r\n	<li>&nbsp;Bed repairs.</li>\r\n	<li>&nbsp;Hanging and staircase construction.</li>\r\n	<li>&nbsp;Dressing table repair.</li>\r\n	<li>&nbsp;Benches, board construction.</li>\r\n	<li>&nbsp;Dining table with chair repair and construction.</li>\r\n</ul>\r\n', '1', NULL, NULL);
INSERT INTO `services` (`id`, `name`, `image`, `description`, `status`, `created_at`, `updated_at`) VALUES
(8, 'Electrical', , '<p>HomeService provides you best Electricians in the Jabalpur city. Any kinds of repair service or replacement in electrical appliances which you need in your home, in office or anywhere, feel free to contact us.<br />\r\n<br />\r\n<strong>Following points we use to provide in our services of electrical installation:</strong></p>\r\n\r\n<h2>Basic electrical repairs and replacement</h2>\r\n\r\n<p>HomeService have team of experienced electricians, which repair and replace the electric appliances with full safety. You do not need to worry when you are with the team of HomeService.<br />\r\n<strong>Our electrical repairs department will deliver you following services:</strong></p>\r\n\r\n<ul>\r\n	<li>&nbsp;Repair of wiring.</li>\r\n	<li>&nbsp;Repairing of switches and circuit box.</li>\r\n	<li>&nbsp;Outlet repairs.</li>\r\n	<li>&nbsp;Circuit breaker repair.</li>\r\n	<li>&nbsp;Installing electrical panels.</li>\r\n	<li>&nbsp;Table fan, wall fan and Ceiling fan repairs.</li>\r\n</ul>\r\n\r\n<p><strong>Our electrical replacement department will deliver you following services:</strong></p>\r\n\r\n<ul>\r\n	<li>&nbsp;Electrical Panel.</li>\r\n	<li>&nbsp;Fixture replacement.</li>\r\n	<li>&nbsp;Ceiling fan parts.</li>\r\n	<li>&nbsp;Switch panel and switch replacement.</li>\r\n	<li>&nbsp;Wiring replacement.</li>\r\n	<li>&nbsp;Circuit breaker replacement.</li>\r\n</ul>\r\n\r\n<h2>Electrical Installation</h2>\r\n\r\n<p>Our team of Electricians helps you in electric installation, whether it is indoor or outdoor based.<br />\r\n<strong>Our electrical repairs department will deliver you following services:</strong></p>\r\n\r\n<ul>\r\n	<li>&nbsp;Electrical Installation includes.</li>\r\n	<li>&nbsp;Switch Installation.</li>\r\n	<li>&nbsp;Outlet Installation.</li>\r\n	<li>&nbsp;Interior and exterior light fixture installation.</li>\r\n	<li>&nbsp;Ceiling fan and wall fan installation.</li>\r\n	<li>&nbsp;Hot tub wiring installation.</li>\r\n</ul>\r\n\r\n<h2>Indoor and outdoor lighting installation</h2>\r\n\r\n<p>Our team is expert in the field of lighting installation anywhere in your home or offices, which will give more attractive look your place. Our goal is to make customers satisfy by fulfilling their requirements in less time and at low price.<br />\r\n<strong>Our lighting installation department will deliver you following services:</strong></p>\r\n\r\n<ul>\r\n	<li>&nbsp;Landscape lighting installation.</li>\r\n	<li>&nbsp;Security lighting Installation.</li>\r\n	<li>&nbsp;Outdoor fixture installation.</li>\r\n	<li>&nbsp;In home lighting installation.</li>\r\n	<li>&nbsp;LEDs lighting designing using Dialux and installation.</li>\r\n	<li>&nbsp;Porch lighting design and installation.</li>\r\n</ul>', '1', NULL, NULL);

